INSERT INTO `ec_reviews` VALUES (1,3,NULL,NULL,39,3.00,'Great system, great support, good job Botble. I\'m looking forward to more great functional plugins.','published','2024-06-18 23:07:04','2024-06-18 23:07:04','[\"products\\/18-2.jpg\",\"products\\/18-3.jpg\",\"products\\/41-2.jpg\",\"products\\/55-2.jpg\"]'),(2,4,NULL,NULL,57,3.00,'Clean & perfect source code','published','2024-06-18 23:07:04','2024-06-18 23:07:04','[\"products\\/19-3.jpg\",\"products\\/28-2.jpg\",\"products\\/31.jpg\"]'),(3,8,NULL,NULL,49,2.00,'Second or third time that I buy a Botble product, happy with the products and support. You guys do a good job :)','published','2024-06-18 23:07:04','2024-06-18 23:07:04','[\"products\\/43-1.jpg\"]'),(4,9,NULL,NULL,41,5.00,'These guys are amazing! Responses immediately, amazing support and help... I immediately feel at ease after Purchasing..','published','2024-06-18 23:07:04','2024-06-18 23:07:04','[\"products\\/8-1.jpg\",\"products\\/24-1.jpg\",\"products\\/45.jpg\",\"products\\/59-3.jpg\"]'),(5,2,NULL,NULL,58,4.00,'We have received brilliant service support and will be expanding the features with the developer. Nice product!','published','2024-06-18 23:07:04','2024-06-18 23:07:04','[\"products\\/27-1.jpg\",\"products\\/31-1.jpg\",\"products\\/62.jpg\",\"products\\/63.jpg\"]'),(6,6,NULL,NULL,34,4.00,'This script is well coded and is super fast. The support is pretty quick. Very patient and helpful team. I strongly recommend it and they deserve more than 5 stars.','published','2024-06-18 23:07:04','2024-06-18 23:07:04','[\"products\\/11-1.jpg\",\"products\\/11-2.jpg\",\"products\\/35.jpg\",\"products\\/61-1.jpg\"]'),(7,9,NULL,NULL,1,4.00,'This script is well coded and is super fast. The support is pretty quick. Very patient and helpful team. I strongly recommend it and they deserve more than 5 stars.','published','2024-06-18 23:07:04','2024-06-18 23:07:04','[\"products\\/39.jpg\",\"products\\/62-1.jpg\"]'),(8,1,NULL,NULL,4,2.00,'The best ecommerce CMS! 